<title>通用一次性防红接口</title>
<meta charset="utf-8" />

<body class="is-preload">
<header id="header">
<h1>通用一次性防红接口</h1>
<div style="margin: 0; padding: 0;">
<p style="margin: 0; padding: 0;">
在下方输入需要跳转的链接，即可生成防红接口。<br>
复制下方生成的链接，粘贴到微信或者QQ即可。</p>
<p style="margin: 0; padding: 0;font-size: 14px;">
(直链打开可解决QQ提示非官方页面问题)</p>
<p style="margin: 0; padding: 0;font-size: 14px;">
(请勿生成<a href="//urlsec.qq.com/eviltype.html" target="_blank">非法内容</a>，否则后果自负&nbsp;用户反馈群:<a id="Link">598393246</a>)</p></div>
</div>
</header>
<form id="signup-form" method="post">
<input type="url" name="targetUrl" id="targetUrl" placeholder="需要生成的网址" onkeydown="HandleKeyDown(event)"/>
<select name="type" class="btn-default form-control" style="width: auto; cursor: pointer;" title="点击选择生成接口" id="type" onchange="var url=this.options[this.selectedIndex].getAttribute('back'); if(url){var fhLink = document.createElement('a');fhLink.href = url;fhLink.textContent = '点击返回主页';document.getElementById('generatedUrl').textContent = '';document.getElementById('generatedUrl').appendChild(fhLink);window.location.href=url;}">
<option>选择接口...</option>
<option value="ALL_OPEN">通用一次性直链打开</option>
<option value="ALL_JUMP">通用一次性跳浏览器</option>
<option value="GET_QR">网址转二维码在线生成</option>
<option value="Custom">定制防红请进群申请</option>
<option back="https://fanghong.zeabur.app">点击返回主页</option>
</select>
<input type="button" id="button" value="生成" onclick="get_fhUrl()" />
</form>
